 on!',4),(19439,'Aragorn.',4),(19440,'Elessar.',4),(19441,'For Frodo.',4),(19442,'Look, Mr.',4),(19443,'Frodo.',4),(19444,'A doorway.',4),(19445,'We\'re almost there.',4),(19446,'Clever Hobbits to climb so high!',4),(19447,'Mustn\'t go that way.',4),(19448,'Mustn\'t hurt the precious.',4),(19449,'You swore!',4),(19450,'You swore on the precious!',4),(19451,'Sm',4),(19452,'agol promised!',4),(19453,'Sm',4),(19454,'agol lied.',4),(19455,'Frodo!',4),(19456,'Eagles.',4),(19457,'The eagles are coming!',4),(19458,'Frodo!',4),(19459,'I\'m here, Sam.',4),(19460,'Destroy it!',4),(19461,'Go on!',4),(19462,'Now!',4),(19463,'Throw it in the fire!',4),(19464,'What are you waiting for?',4),(19465,'Just let it go!',4),(19466,'The Ring is mine.',4),(19467,'No.',4),(19468,'No.',4),(19469,'No!',4),(19470,'Yes!',4),(19471,'Yes!',4),(19472,'Precious!',4),(19473,'Precious!',4),(19474,'Precious!',4),(19475,'Precious!',4),(19476,'Give me your hand!',4),(19477,'Take my hand!',4),(19478,'No!',4),(19479,'Don\'t you let go.',4),(19480,'Don\'t let go.',4),(19481,'Reach!',4),(19482,'Frodo!',4),(19483,'Frodo!',4),(19484,'It\'s gone.',4),(19485,'It\'s done.',4),(19486,'Yes, Mr.',4),(19487,'Frodo.',4),(19488,'It\'s over now.',4),(19489,'I can see the Shire.',4),(19490,'The Brandywine River.',4),(19491,'Bag End.',4),(19492,'Gandalf\'s fireworks.',4),(19493,'The lights in the Party Tree.',4),(19494,'Rosie Cotton dancing.',4),(19495,'She had ribbons in her hair.',4),(19496,'If ever I was to marry someone...',4),(19497,'... it would\'ve been her.',4),(19498,'It would\'ve been her.',4),(19499,'I\'m glad to be with you,\r\nSamwise Gamgee...',4),(19500,'...here at the end of all things.',4),(19501,'Gandalf?',4),(19502,'Frodo!',4),(19503,'Gimli!',4),(19504,'Now come the days of the king.',4),(19505,'May they be blessed.',4),(19506,'This day does not belong to one man...',4),(19507,'...but to all.',4),(19508,'Let us together rebuild this world...',4),(19509,'...that we may share\r\nin the days of peace.',4),(19510,'My friends...',4),(19511,'...you bow to no one.',4),(19512,'And thus it was.',4),(19513,'A Fourth Age of Middle-earth began.',4),(19514,'And the Fellowship of the Ring...',4),(19515,'...though eternally bound\r\nby friendship and love...',4),(19516,'...was ended.',4),(19517,'Thirteen months to the day since Gandalf\r\nsent us on our long journey...',4),(19518,'...we found ourselves\r\nlooking upon a familiar sight.',4),(19519,'We were home.',4),(19520,'Hi.',4),(19521,'Hey, watch the pumpkin.',4),(19522,'More of the same, Rosie.',4),(19523,'Good night, lads.',4),(19524,'How do you pick up the threads\r\nof an old life?',4),(19525,'How do you go on...',4),(19526,'...when in your heart\r\nyou begin to understand...',4),(19527,'...there is no going back?',4),(19528,'There are some things\r\nthat time cannot mend...',4),(19529,'...some hurts that go too deep...',4),(19530,'...that have taken hold.',4),(19531,'there and back again...',4),(19532,'a hobbit\'s tale, by Bilbo Baggins\r\n\r\n\nMr.',4),(19533,'Frodo?',4),(19534,'What is it?',4),(19535,'It\'s been four years to the day\r\nsince Weathertop, Sam.',4),(19536,'It\'s never really healed.',4),(19537,'There and Back Again',4),(19538,'A Hobbit\'s Tale\r\nby Bilbo Baggins.',4),(19539,'And The Lord of the Rings\r\nby Frodo Baggins.',4),(19540,'You finished it.',4),(19541,'Not quite.',4),(19542,'There\'s room for a little more.',4),(19543,'Bilbo once told me his part\r\nin this tale would end...',4),(19544,'...that each of us must come and go\r\nin the telling.',4),(19545,'Bilbo\'s story was now over.',4),(19546,'There would be no more journeys\r\nfor him...',4),(19547,'...save one.',4),(19548,'Tell me again, lad,\r\nwhere are we going?',4),(19549,'To the harbour, Bilbo.',4),(19550,'The Elves have accorded you\r\na special honour...',4),(19551,'...a place on the last ship\r\nto leave Middle-earth.',4),(19552,'Frodo...',4),(19553,'...any chance of seeing\r\nthat old Ring of mine again?',4),(19554,'The one I gave you.',4),(19555,'I\'m sorry, Uncle.',4),(19556,'I\'m afraid I lost it.',4),(19557,'Oh.',4),(19558,'Pity.',4),(19559,'I should like to have held it\r\none last time.',4),(19560,'Well, here\'s a sight\r\nI have never seen before.',4),(19561,'The power of the Three Rings is ended.',4),(19562,'The time has come...',4),(19563,'...for the dominion of Men.',4),(19564,'The sea calls us home.',4),(19565,'I think I\'m...',4),(19566,'...quite ready\r\nfor another adventure.',4),(19567,'Farewell...',4),(19568,'...my brave Hobbits.',4),(19569,'My work is now finished.',4),(19570,'Here at last,\r\non the shores of the sea...',4),(19571,'...comes the end of our Fellowship.',4),(19572,'I will not say,',4),(19573,'Do not weep',4),(19574,'...for not all tears are an evil.',4),(19575,'It is time, Frodo.',4),(19576,'What does he mean?',4),(19577,'We set out to save the Shire, Sam.',4),(19578,'And it has been saved.',4),(19579,'But not for me.',4),(19580,'You don\'t mean that.',4),(19581,'You can\'t leave.',4),(19582,'The last pages are for you, Sam.',4),(19583,'My dear Sam\nYou cannot always be torn in two.',4),(19584,'You will have to be one and whole\r\nfor many years.',4),(19585,'You have so much to enjoy\r\nand to be and to do.',4),(19586,'Your part in the story will go on.',4),(19587,'Well...',4),(19588,'... I\'m back.',4),(19589,'Lay down\r\n\r\n\nYour sweet and weary head\r\n\r\n\nNight is falling\r\n\r\n\nYou have come\r\nTo journey\'s end\r\n\r\n\nSleep now\r\n\r\n\nAnd dream\r\nOf the ones who came before\r\n\r\n\nThey are calling\r\n\r\n\nFrom across\r\nThe distant shore\r\n\r\n\nWhy do you weep?',4),(19590,'What are these tears\r\nUpon your face?',4),(19591,'Soon you will see\r\n\r\n\nAll ofyour fears\r\nWill pass away\r\n\r\n\nSafe in my arms\r\n\r\n\nYou\'re only sleeping\r\n\r\n\nWhat can you see\r\n\r\n\nOn the horizon?',4),(19592,'Why do the white gulls\r\n\r\n\nCall?',4),(19593,'Across the sea\r\n\r\n\nA pale moon rises\r\n\r\n\nThe ships have come\r\n\r\n\nTo carry you home\r\n\r\n\nAnd all will turn\r\n\r\n\nTo silver glass\r\n\r\n\nA light on the water\r\n\r\n\nAll souls pass\r\n\r\n\nHope fades\r\n\r\n\nInto the world of night\r\n\r\n\nThrough shadows falling\r\n\r\n\nOut of memory and time\r\n\r\n\nDon\'t say\r\n\r\n\nWe have come now to the end\r\n\r\n\nWhite shores are calling\r\n\r\n\nYou and I will meet again\r\n\r\n\nAnd you\'ll be here\r\nIn my arms\r\n\r\n\nJust sleeping\r\n\r\n\nWhat can you see\r\n\r\n\nOn the horizon?',4),(19594,'Why do the white gulls\r\n\r\n\nCall?',4),(19595,'Across the sea\r\n\r\n\nA pale moon rises\r\n\r\n\nThe ships have come\r\n\r\n\nTo carry you home\r\n\r\n\nAnd all will turn\r\n\r\n\nTo silver glass\r\n\r\n\nA light on the water\r\n\r\n\nGrey ships pass\r\n\r\n\nInto the West',4);
